import { Component, Input, OnInit } from "@angular/core";
import { DomSanitizer, SafeUrl } from "@angular/platform-browser";
import { DocumentModel } from "../../models/Document.model";
import { FileService } from "../../services/file.service";

@Component({
  selector: "app-file-showing",
  templateUrl: "./file-showing.component.html",
  styleUrls: ["./file-showing.component.css"],
})
export class FileShowingComponent implements OnInit {
  @Input()
  document: DocumentModel;
  imageToShowLicense: any;
  content: any;
  imageURL: SafeUrl;
  result: any;
  base64Content: any;
  private BASE64_DATA_URI_PREFIX = "data:image/pdf;base64,";
  openFile: boolean = false;
  link: string;
  fileUrl: SafeUrl;

  constructor(
    private sanitizer: DomSanitizer,
    private fileService: FileService
  ) {}

  ngOnInit() {
    this.onAdditionalDownload();
  }

  showFile() {
    let name = this.document.path;
    if (this.document && this.document.name) {
      name = this.document.name;
    } else {
      name = this.document.path.substr(
        this.document.path.lastIndexOf("/"),
        this.document.path.length
      );
    }
    this.fileService.getImage(this.document.uuid).subscribe((res: Blob) => {
      this.createImageFromBlob2(res, "logo");
      // this.downloadBuffer(res, name);

      // this.blobToBase64(res).then(res => {
      //   this.base64Content = res;
      // });
    });
  }

  createImageFromBlob2(image: Blob, file: string) {
    let reader = new FileReader();
    reader.addEventListener(
      "load",
      () => {
        if (file === "logo") {
          var pdfBase =
            "";
          this.base64Content = "data:application/pdf;base64,";
          var windo = window.open("", "");
          var objbuilder = "";
          // objbuilder += ('<embed width=\'50%\' height=\'50%\'  src="data:application/pdf;base64,');
          // objbuilder += (pdfBase);
          // objbuilder += ('" type="application/pdf" />');
          // windo.document.write(objbuilder);

          windo.document.write(
            "<iframe width='100%' height='100%' src='data:application/pdf;base64, " +
              encodeURI(pdfBase) +
              "'></iframe>"
          );

          //////////////////////////////////////////////////////////////////////////////////
          //         this.base64Content = 'data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,';
          //         var windo = window.open("", "");
          //         var objbuilder = '';
          //         objbuilder += ('<embed width=\'100%\' height=\'100%\'  src="data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,');
          //         objbuilder += ('');
          //         objbuilder += ('" type="application/vnd.openxmlformats-officedocument.wordprocessingml.document" />');
          //         windo.document.write(objbuilder);
        }
      },
      false
    );

    if (image) {
      reader.readAsDataURL(image);
    }
  }

  blobToBase64(blob): Promise<any> {
    return new Promise((resolve, _) => {
      const reader = new FileReader();
      reader.onloadend = () => resolve(reader.result);
      reader.readAsDataURL(blob);
    });
  }

  downloadBuffer(arrayBuffer, name) {
    const a = document.createElement("a");
    a.href = URL.createObjectURL(
      new Blob([arrayBuffer], {
        type: "application/vnd.openxmlformats-officedocument.wordprocessingml.document",
      })
    );
    this.content = this.sanitizer.bypassSecurityTrustUrl(
      URL.createObjectURL(
        new Blob([arrayBuffer], {
          type: "application/vnd.openxmlformats-officedocument.wordprocessingml.document",
        })
      )
    );
    this.imageURL = URL.createObjectURL(
      new Blob([arrayBuffer], {
        type: "application/vnd.openxmlformats-officedocument.wordprocessingml.document",
      })
    );
    a.download = name;
    a.click();
  }

  createImageFromBlob(image: Blob) {
    let reader = new FileReader();
    reader.addEventListener(
      "load",
      () => {
        this.imageToShowLicense = reader.result;
      },
      false
    );
    if (image) {
      reader.readAsDataURL(image);
    }
  }

  downloadFile() {
    let name = this.document.path;
    if (this.document && this.document.name) {
      name = this.document.name;
    } else {
      name = this.document.path.substr(
        this.document.path.lastIndexOf("/"),
        this.document.path.length
      );
    }
    this.fileService.getImage(this.document.uuid).subscribe((res: Blob) => {
      this.downloadBuffer(res, name);
    });
  }

  public onAdditionalDownload(): void {
    this.link = null;
    this.openFile = false;
    this.fileService
      .showContent(this.document.uuid)
      .pipe()
      .subscribe((response) => {
        this.fileUrl = response.url;
        // let FileName = response.headers.get("content-disposition");
        let blob: Blob = response.body as Blob;
        let a = document.createElement("a");
        // a.download = FileName;
        a.href = window.URL.createObjectURL(blob);
        this.link = a.href;
        // a.click();
        this.openFile = true;
      });
  }
}
